import React from "react";

import "./checkout.styles.scss";

const Checkout = () => {
  return 
  (
  <div className="checkout-page">
      <div className="checkout-header">
          <div className="header-block">
              <span>Product</span>
          </div>
          <div className="header-block">
              <span>Description</span>
          </div>
          <div className="header-block">
              <span>Quantity</span>
          </div>
          <div className="header-block">
              <span>Product</span>
          </div>
      </div>
  </div>
  );
};

export default Checkout;
